import { Grid, GridList, GridListTile, GridListTileBar, IconButton, Paper } from '@material-ui/core';
import React from 'react';
import DriveEtaIcon from '@material-ui/icons/DriveEta';

interface Expense
{
    id: number,
    purseId: number,
    title: string,
    date: Date,
    money: number,
    topic: string
}


const expenses: Expense[] = [];

export const ExpensesList: React.FC = () => {

    return(
        <GridList cellHeight={300}
        cols={3} style={{width:"100%"}}
        >
            <Grid container xs={12}
            justif
            >
                <Grid item xs={12}>
                    <Paper style={{padding:10}}>
                            Title item gfsdg
                        </Paper> 
                </Grid>
            </Grid>
        </GridList>
    );
}

export default ExpensesList;
